                        url = {medicine_chest}
                        width = {100}
                        height = {100}
                    />
                    <LargeButton className="function"
                        url = {medicine_chest}
                        width = {100}
                        height = {100}
                    />
                    <LargeButton className="function"
                        url = {medicine_chest}
                        width = {100}
                        height = {100}
                    />
                    <LargeButton className="function"
                        url = {medicine_chest}
                        width = {100}
                        height = {100}
                    />
                    <LargeButton className="function"
                        url = {medicine_chest}
                        width = {100}
                        height = {100}
                    />
                </div>
            </div>
        )
    }

}

export default Home;
